export const getUpdateTurmaUrl = (id: number,) => {


  

  return `http://localhost:3333/api/v1/turma/${id}`
}

export const updateTurma = async (id: number,
    turmaDto: TurmaDto, options?: RequestInit): Promise<updateTurmaResponse> => {
  
  const res = await fetch(getUpdateTurmaUrl(id),
  {      
    ...options,
    method: 'PUT',
    headers: { 'Content-Type': 'application/json', ...options?.headers },
    body: JSON.stringify(
      turmaDto,)
  }
)

  const body = [204, 205, 304].includes(res.status) ? null : await res.text();
  
  const data: updateTurmaResponse['data'] = body ? JSON.parse(body) : {}
  return { data, status: res.status, headers: res.headers } as updateTurmaResponse
}



export type getUserByIdResponse200 = {
  data: User
  status: 200
}
    
export type getUserByIdResponseSuccess = (getUserByIdResponse200) & {
  headers: Headers;
};
;

export type getUserByIdResponse = (getUserByIdResponseSuccess)

export const getGetUserByIdUrl = (params: GetUserByIdParams,) => {
  const normalizedParams = new URLSearchParams();

  Object.entries(params || {}).forEach(([key, value]) => {
    
    if (value !== undefined) {
      normalizedParams.append(key, value === null ? 'null' : value.toString())
    }
  });

  const stringifiedParams = normalizedParams.toString();

  return stringifiedParams.length > 0 ? `http://localhost:3333/api/v1/user?${stringifiedParams}` : `http://localhost:3333/api/v1/user`
}

export const getUserById = async (params: GetUserByIdParams, options?: RequestInit): Promise<getUserByIdResponse> => {
  
  const res = await fetch(getGetUserByIdUrl(params),
  {      
    ...options,
    method: 'GET'
    
    
  }
)

  const body = [204, 205, 304].includes(res.status) ? null : await res.text();
  
  const data: getUserByIdResponse['data'] = body ? JSON.parse(body) : {}
  return { data, status: res.status, headers: res.headers } as getUserByIdResponse
}



